package cn.com.evo.integration.guangxi.content.xml.model;import javax.xml.bind.annotation.XmlElement;import javax.xml.bind.annotation.XmlType;import java.util.List;/** * @Description: * @author: lu.xin * @create: 2019-05-14 1:45 PM **/@XmlType(propOrder = {        "ams",        "appData",})public class Metadata {    private AMS ams;    private List<AppData> appData;    public Metadata() {    }    public Metadata(AMS ams, List<AppData> appData) {        this.ams = ams;        this.appData = appData;    }    public static Metadata createMetadata(AMS ams, List<AppData> appData) {        Metadata metadata = new Metadata(ams, appData);        return metadata;    }    @XmlElement(name = "AMS")    public AMS getAms() {        return ams;    }    @XmlElement(name = "App_Data")    public List<AppData> getAppData() {        return appData;    }    public void setAms(AMS ams) {        this.ams = ams;    }    public void setAppData(List<AppData> appData) {        this.appData = appData;    }}